import React from 'react';

// Composents
import {Footer} from './Footer';
import { NavBar } from './NavBar';
import {LisAtors} from './LisAtors'
import { Register } from './Register';


export const Home = () => {

    const {id} : {id :string} = useParams();

    const [state, setState] = useState('');


    useEffect(() => {
        if (id === ""){
            setState(<Signup/>)
        } else if( id === "login"){
            setState(<Login/>)
        }
    }, [setState,id])


    return (
        <div>
            <NavBar/>
            <Register/>
            <Footer/>
        </div>
    )
}
